import React from 'react';
import { TodoIcon } from './TodoIcon';

function DeleteIcon({ onDelete, text }) {
    return (
        <TodoIcon
            type="delete"
            color="red" 
            onDelete={onDelete}
            text={text}
        />
    );
}

export { DeleteIcon };
